// ==UserScript==
// @name        Fimfiction 2.0
// @namespace   sollace-fimfiction
// @description Enabler for the Fimfiction 2.0 beta access. For more information on this amazing offer, please go to https://www.fimfiction.net/b...
// @icon        http://sollace.github.io/images/favicon.png
// @include     http://www.fimfiction.net/*
// @include     https://www.fimfiction.net/*
// @require     https://github.com/Sollace/UserScripts/raw/master/Internal/jquery-1.8.3.min.wrap.js
// @require     https://github.com/Sollace/UserScripts/raw/master/Internal/Events.user.js
// @version     1
// @grant       none
// ==/UserScript==

(function() {
  var access_string = '';
  var derpicatch = derpicatch || {
    'safe,eggplant,-comic': [
      '//derpicdn.net/img/view/2012/7/27/58239.gif',
      '//derpicdn.net/img/view/2012/9/30/110151.png',
      '//derpicdn.net/img/view/2012/12/14/182101.jpg',
      '//derpicdn.net/img/view/2013/2/5/234228.jpg',
      '//derpicdn.net/img/view/2013/4/4/287661.jpg',
      '//derpicdn.net/img/view/2013/5/9/320413.jpg',
      '//derpicdn.net/img/view/2013/8/9/395507.png',
      '//derpicdn.net/img/view/2013/8/22/407425.jpeg',
      '//derpicdn.net/img/view/2013/12/20/501655.png',
      '//derpicdn.net/img/view/2013/12/21/502682.png',
      '//derpicdn.net/img/view/2013/12/31/511428.jpg',
      '//derpicdn.net/img/view/2014/1/24/532840.png',
      '//derpicdn.net/img/view/2014/1/31/539038.jpeg',
      '//derpicdn.net/img/view/2014/2/2/541146.png',
      '//derpicdn.net/img/view/2014/2/3/542528.png',
      '//derpicdn.net/img/view/2014/11/3/756987.png',
      '//derpicdn.net/img/view/2014/9/21/726597.png',
      '//derpicdn.net/img/view/2014/9/6/716334.png',
      '//derpicdn.net/img/view/2014/7/17/677051.png',
      '//derpicdn.net/img/view/2014/4/25/609405.jpg',
      '//derpicdn.net/img/view/2015/11/27/1031355.png',
      '//derpicdn.net/img/view/2015/4/26/883116.png',
      '//derpicdn.net/img/view/2015/3/25/856739.jpg',
      '//derpicdn.net/img/view/2016/10/19/1277024.png',
      '//derpicdn.net/img/view/2016/7/2/1191730.png',
      '//derpicdn.net/img/view/2016/1/14/1066562.jpg',
      '//derpicdn.net/img/view/2016/1/14/1066451.png',
      '//derpicdn.net/img/view/2016/1/14/1066322.png'
    ],
  };
  [].push.apply(derpicatch['eggplant,-comic'] = [
    '//derpicdn.net/img/view/2014/7/1/665321.png',
    '//derpicdn.net/img/view/2015/11/30/1033624.png'
  ], derpicatch['safe,eggplant,-comic']);

  function derpibooru(term, callback) {
    if (getCookie('view_mature') != 'true') term = 'safe,' + term;
    if (derpicatch[term]) return callback(derpicatch[term]);
    $.ajax({
      url: '//derpibooru.org/search.json?utf8=?&sf=created_at&sd=asc&q=' + term,
      method: 'GET',
      success: function(json) {
        var images = [];
        $.each(json.search, function() {
          images.push(this.image);
        });
        callback(images);
        derpicatch[term] = images;
      }
    });
  }

  function stringHash(string) {
    if (string.indexOf('/user/') != -1 || string.indexOf('/story/') != -1) {
      string = string.split('-');
      string.pop();
      string = string.join('-');
    }
    var hash = 0;
    for (var i = 0; i < string.length; i++) {
      hash += string.charCodeAt(i);
    }
    return hash;
  }

  function textNodes(el, callback) {
    $.each(el.childNodes, function() { if (this.nodeType == 3) callback(this); });
  }

  var ss = 'Eggplant';
  function doSS(text) {
    text = text.split(' ');
    $.each(text, function(i) {
      if (this.length >= 7 ? stringHash(this) % 3 < 2 : stringHash(this) % 7 > 5) {
        text[i] = this.replace(/[A-Z][a-z]+/,ss);
        if (text[i] == this) text[i] = this.replace(/[a-z]+/, ss);
        if (text[i] == this) text[i] = this.replace(/[A-Z]+/, ss.toUpperCase());
        if (text[i] != this && this[this.length - 1].toUpperCase() == 'S' && text[i][text[i].length - 1].toUpperCase() != 'S') text[i] += 's';
      } else {
        text[i] = this.replace(/Anthrop/, ss);
        text[i] = this.replace(/Sins/, ss + 's');
      }
    });
    return text.join(' ');
  }

  function run() {
    derpibooru('eggplant,-comic', function(images) {
      $('img.avatar,img.story_medium,img.story_thumbnail,img.group_icon,.avatar > img,img.story_image,.avatar-container > a[href*="/user/"] > img,.image-container > a[href*="/story/"] > img,div.user-avatar').each(function() {
        var me = $(this);
        var src = me.attr('src') || me.attr('data-src') || (me.attr('data-srcset') || '').split(' ')[0];
        if (src && src.indexOf('.fimfiction.net') == -1) return;
        if (!src) {
          src = me.css('background-image');
          if (src && src.indexOf('.fimfiction.net') != -1) {
            me.css({ 'background-image': 'url(' + images[stringHash(src.split(/[\(\)]/)[1].replace(/['"]/,'')) % images.length] + ')', 'background-size': 'cover' });
          }
          return;
        }
        var id = stringHash(src);
        var h = me.height(), w = me.width();
        h = h > 0 ? h : src.indexOf('/user/') != -1 ? (src.split('-').reverse()[0] + 'px') : '128px';
        w = w > 0 ? w : src.indexOf('/user/') != -1 ? src.split('-').reverse()[0] + 'pc' : '128px';
        me.removeClass('lazy-img').css({ 'max-width': w, 'height': h, 'max-height': h }).attr({ 'data-srcset': images[id % images.lenth], 'data-src': images[id % images.lenth], 'src': images[id % images.length], 'srcset': images[id % images.length] });
      });
    });
    $('a[href^="/user/"]:not(.skip), a[href^="/user/"] > i.fa.fa-user + span:not(.skip)').each(function() {
      var me = $(this);
      me.addClass('skip');
      if (me.children().length == 0) {
        me.text(me.text().replace(/[aeiou]/gi, ss));
      }
    });
    $('a[href^="/story/"]:not(.skip), li[id^=featured_story_link_]:not(.skip)').each(function() {
      this.classList.add('skip');
      textNodes(this, function(nod) {
        if (nod.textContent && nod.textContent.length) {
          nod.textContent = doSS(nod.textContent);
        }
      });
    });
    $('img.emoticon, .drop-down-emoticons img').after('??').remove();
    run_distribution();
  }
  
  function run_distribution() {
    $('#home_link img, a.home_link img').each(function() {
      var me = $(this);
      var h = me.height();
      h = h > 0 ? h : src.indexOf('/user/') != -1 ? (src.split('-').reverse()[0] + 'px') : '128px';
      me.removeClass('lazy-img').css({ 'max-width': me.width(), 'height': h, 'max-height': h }).attr('src', 'data:image/png;base64,' + access_string);
    });
  }
  
  FimFicEvents.on('afterinfocard afterpagechange afteraddcomment afterlistpms afterlistnotes afterpreviewcomment afterlistemoticons', run);
  
  setTimeout(run_distribution, 1);
  run();
  $('head').append('<style type="text/css">.nav_bar .notifications-link::before,.fa-thumbs-up::before,.fa-thumbs-o-up::before {content: "??";}.comment .comment_information .comment_likable i.like {opacity: 0.5;}.comment .comment_information .comment_likable .comment_liked i.like {opacity: 1;}</style>');
  console.log("Happy April 1st.");
})();